import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const name = "Afnan";
const img1 = "https://images.pexels.com/photos/10611875/pexels-photo-10611875.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load";
const img2 = "https://images.pexels.com/photos/10611873/pexels-photo-10611873.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load";
const img3 = "https://images.pexels.com/photos/10611843/pexels-photo-10611843.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load";

const heading = {
    margin: "70px 0",
    color: "brown",
    fontWeight: "bold",
    textAlign: "center",
    fontFamily: "'Open Sans', sans-serif"
}
ReactDOM.render(
    <>
        <h1 style={heading}>My Name is {name}</h1>
        <div className="img_box">
            <img src = {img1} alt="randomImg" />
            <img src = {img2} alt="randomImg" />
            <img src = {img3} alt="randomImg" />
        </div>
    </>,
    document.getElementById("root")
);
